import React from "react";
import "./styles.css"; // Ensure the CSS file is imported

const OtherPage = () => {
  return (
    <div>
      <nav>
        <a href="/">Home</a>
        <a href="/page2.html" aria-current="page">
          Other page
        </a>
      </nav>
      <main>
        <h1>My other page</h1>
      </main>
    </div>
  );
};

export default OtherPage;
